import React, { Component } from 'react';



//import'./game.css'

const GameComponent = {
    height: "500px",
    width: "500px",
    display: "flex",
    flexWrap: "wrap",
    border: "1px solid black",
    boxSizing: "border-box"
}
const Cell = {

    display: "flex",
    flexWrap: "wrap",
    border: "1px solid black",
    boxSizing: "border-box"
}

export default class Game extends Component {

    state = {
        sizeEasyMode: true
    }


    async componentDidMount() {
        const response = await
            fetch('https://starnavi-frontend-test-task.herokuapp.com/game-settings'
            )
        const gameSettings = await response.json()
        const sizeEasyMode = gameSettings.easyMode.field;
          //let sizeNormalMode = gameSettings.normalMode.field;
        //let sizeHardMode = gameSettings.hardMode.field;

        //let delayTimeEasyMode = gameSettings.easyMode.delay;
        //let delayTimeNormalMode = gameSettings.normalMode.delay;
        //let delayTimeHardMode = gameSettings.hardMode.delay;
        const w = gameSettings.easyMode.field;
        console.log (sizeEasyMode);
    }


     render() {

        return (

            <div  style ={GameComponent}>
                <div style = {{
                    height: this.state.sizeEasyMode,
